import React from 'react'

import { Switch,Route } from 'react-router-dom'
import Home from './Pages/Home/Home'
import App from './App'
const Routes = () => {
  return (
    <Switch>
      <Route exact path='/' component='Home'/>
      <Route exact path='/Auth'/>
    </Switch>
  )
}

export default Routes
